import React from 'react';
import NextVideoData from '../../data/videos.json';
import NextVideosList from './NextVideosList';

console.log(NextVideoData)
function NextVideos() {
    const videoListData = NextVideoData.map((elemnt,index) => {
        return <NextVideoList videoList ={elemnt} key={'video' + index} />;
    })
    console.log(videoListData)

    return (
        <section className="nextvideos">
            <h2>NEXT VIDEOS</h2>
            <NextVideosList videoList={NextVideoData} />
        </section>
    )
}

export default NextVideos
